var title_f3_21_3419="Criteria seasonal pattern";
var content_f3_21_3419=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=PC%2F55628&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=PC%2F55628&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    DSM-IV TR criteria for seasonal pattern specifier",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td>",
"        Regular temporal",
"relationship between the onset of major depressive episodes in Bipolar",
"I or Bipolar II Disorder or Major Depressive Disorder, recurrent, and a",
"particular time of the year unrelated to obvious season-related",
"psychosocial stressors",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Full remissions (or a change from depression to mania or hypomania) also occur at a characteristic time of the year",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Two major depressive episodes meeting criteria A and B in last 2 years and no nonseasonal episodes in the same period",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Seasonal major depressive episodes substantially outnumber the nonseasonal episodes over the individual's lifetime",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Adapted from American Psychiatric Association. Diagnostic and Statistical Manual of Mental Disorders, 4th ed, American Psychiatric Association, Washington, DC 2000.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
