var title_f3_21_3420="Continuation or discontinuation of anticoagulation";
var content_f3_21_3420=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=HEME%2F84025&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=10\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=HEME%2F84025&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=10\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    2012 ACCP guidelines for continuation or discontinuation of anticoagulation after the first three months",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <colgroup span=\"4\" width=\"25%\">",
"     </colgroup>",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1\" rowspan=\"2\">",
"        Thrombotic recurrence risk group",
"       </td>",
"       <td class=\"subtitle1\" colspan=\"3\">",
"        Bleeding risk group*",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2\">",
"        Low",
"       </td>",
"       <td class=\"subtitle2\">",
"        Intermediate",
"       </td>",
"       <td class=\"subtitle2\">",
"        High",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        First VTE provoked by surgery",
"       </td>",
"       <td>",
"        Discontinue (strong)",
"       </td>",
"       <td>",
"        Discontinue (strong)",
"       </td>",
"       <td>",
"        Discontinue (strong)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        First VTE provoked by non-surgical factor or first unprovoked distal DVT",
"       </td>",
"       <td>",
"        Discontinue (weak)",
"       </td>",
"       <td>",
"        Discontinue (weak)",
"       </td>",
"       <td>",
"        Discontinue (strong)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        First unprovoked proximal DVT or PE",
"       </td>",
"       <td>",
"        Continue (weak)",
"       </td>",
"       <td>",
"        Continue (weak)",
"       </td>",
"       <td>",
"        Discontinue (strong)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Second unprovoked VTE",
"       </td>",
"       <td>",
"        Continue (strong)",
"       </td>",
"       <td>",
"        Continue (weak)",
"       </td>",
"       <td>",
"        Discontinue (weak)",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    The strength of the recommendation to continue or discontinue is noted in parentheses.",
"    <div class=\"footnotes\">",
"     VTE: venous thromboembolism; DVT: deep vein thrombosis; PE: pulmonary embolism.",
"     <br/>",
"     * The 2012 ACCP bleeding risk model assumes risk of major bleeding after the first three months of anticoagulation as 0.8, 1.6, and &ge;6.5 percent for the low, intermediate, and high risk groups, respectively.",
"    </div>",
"    <div class=\"reference\">",
"     Modified from: Kearon C, Akl EA, Comerota AJ, et al. Antithrombotic therapy for VTE disease: Antithrombotic Therapy and Prevention of Thrombosis, 9th ed: American College of Chest Physicians Evidence-Based Clinical Practice Guidelines. Chest 2012; 141:e419S.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
