var content_f3_21_3421=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=ENDO%2F51539&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=7\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=ENDO%2F51539&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=7\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    The effects of type 1 and type 2 diabetes on bone",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1\">",
"        &nbsp;",
"       </td>",
"       <td class=\"subtitle1\">",
"        Type 1",
"       </td>",
"       <td class=\"subtitle1\">",
"        Type 2",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\" rowspan=\"4\">",
"        Pathology",
"       </td>",
"       <td rowspan=\"3\">",
"        Insulin deficiency",
"       </td>",
"       <td>",
"        Insulin resistance",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Hyperinsulinemia",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Raised IGF-1",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Raised blood glucose",
"       </td>",
"       <td>",
"        Raised blood glucose",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\" rowspan=\"2\">",
"        Age of onset",
"       </td>",
"       <td>",
"        Younger",
"       </td>",
"       <td>",
"        Older",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        May affect peak bone mass",
"       </td>",
"       <td>",
"        Usually maturity onset",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\" rowspan=\"4\">",
"        BMI",
"       </td>",
"       <td rowspan=\"4\">",
"        May be low",
"       </td>",
"       <td>",
"        Usually high",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Increased load on skeleton",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        May protect against impact",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Increased estrogen, leptin, and adiponectin production in adipose tissue",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\" rowspan=\"4\">",
"        Mechanism",
"       </td>",
"       <td>",
"        Hyperglycemia may cause increased urine calcium loss and inhibit bone formation",
"       </td>",
"       <td>",
"        Hyperglycemia may cause increased urine calcium loss and inhibit bone formation",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Bone turnover is usually low",
"       </td>",
"       <td>",
"        Bone turnover is usually low",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Advanced glycosylation end products may affect bone fragility",
"       </td>",
"       <td>",
"        Advanced glycosylation end products may affect bone fragility",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        &nbsp;",
"       </td>",
"       <td>",
"        Anabolic effect of insulin resistance",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\">",
"        BMD",
"       </td>",
"       <td>",
"        May be low",
"       </td>",
"       <td>",
"        May be increased",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\">",
"        Fracture risk",
"       </td>",
"       <td>",
"        Increased",
"       </td>",
"       <td>",
"        Increased",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\" rowspan=\"2\">",
"        Treatment",
"       </td>",
"       <td rowspan=\"2\">",
"        Insulin has anabolic effect",
"       </td>",
"       <td>",
"        Different effects of drugs on fracture risk (reduction with metformin, increase with thiazolinediones)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Insulin has anabolic effect but use marks longstanding or severe diabetes",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\">",
"        Complications",
"       </td>",
"       <td colspan=\"2\">",
"        Micro and macrovascular complications may increase fracture risk by effects on bone (eg, by metabolic effects of nephropathy) or by association with an increased risk of falling (eg, secondary to visual loss, cerebrovascular disease, or neuropathy). Neuropathy-related local bone loss may increase fracture risk at the foot and ankle.",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Sources:",
"     <br>",
"      1. Rakel, A, Sheehy, O, Rahme, E, LeLorier, J. Osteoporosis among patients with type 1 and type 2 diabetes. Diabetes Metab 2008; 34:193.",
"      <br>",
"       2. Adami, S. Bone health in diabetes: considerations for clinical management. Curr Med Res Opin 2009; 25:1057.",
"       <br>",
"        3. Epstein, S, Leroith, D. Diabetes and fragility fractures - a burgeoning epidemic? Bone 2008; 43:3.",
"        <br>",
"         4. McCulloch, D. Thiazolidinediones in the treatment of diabetes mellitus. In: UpToDate, Basow, DS (Ed), UpToDate, Waltham, MA, 2009.",
"        </br>",
"       </br>",
"      </br>",
"     </br>",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
