"    Palmar lip fracture of the base of the middle phalanx with &gt;50 percent involvement of the articular surface",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 324px; height: 432px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Palmar lip fractures are the most common type of fracture of the base of the middle phalanx and result from a combination of proximal interphalangeal joint (PIPJ) hyperextension and axial loading. Patients present with swelling, pain, limited motion at the PIPJ, and a flexed posture. The radiograph shows a dorsal subluxation of the PIPJ.",
